import NewList from "./NewList";

const List = ({ list }) => {
  return (
    <div>
      <ul>
        {Object.keys(list).length &&
          Object.keys(list).map((key, i) => (
            <>
              <li key={key}>{key}</li>
              {/* <NewList list={key} /> */}
            </>
          ))}
      </ul>
    </div>
  );
};

export default List;
